def compute_salary(salary_from: int, salary_to: int, salary_currency: str, date: str) -> int:
    try:
        avg = (salary_from + salary_to) / 2
    except Exception:
        return 0

    # Валюта — рубли
    if salary_currency == "RUR":
        return int(avg)

    # Другая валюта
    if salary_currency:
        try:
            rate = currencies[date].get(salary_currency)
            if rate is None:
                # курса нет — возвращаем 0
                return 0
            return int(avg * rate)
        except (KeyError, TypeError):
            # нет даты или неверные типы
            return 0

    # Пустая валюта
    return 0


def add_one_dict(key, dict_1):
    if key in dict_1:
        dict_1[key] += 1
    else:
        dict_1[key] = 1


def add_value_dicts(key, value, dict_1, dict_2):
    if key in dict_1:
        dict_1[key] += value
        dict_2[key] += 1
    else:
        dict_1[key] = value
        dict_2[key] = 1


def find_medium(dict_1, dict_2, result_dict):
    for key, value in dict_1.items():
        result_dict[key] = int(value/dict_2[key])


def find_proc_dict(dict: dict):
    sum_values = sum(dict.values())
    new_dict = {}
    for key, value in dict.items():
        new_dict[key] = round(value/sum_values, 3)
    return new_dict


def get_top(data, count=20):
    sorted_items = sorted(
        data.items(),
        key=lambda item: item[1],
        reverse=True
    )
    # Берём первые count
    return dict(sorted_items[:count])


def get_top_skills(data, count=20):
    result = {}
    for key, value in data.items():
        sorted_items = sorted(
            value.items(),
            key=lambda item: item[1],
            reverse=True
        )
        result[key] = dict(sorted_items[:count])
    # Берём первые count
    return result


def add_one_skills_dict(key_skills, year, data):
    for key in key_skills:
        if year in data:
            if key in data[year]:
                data[year][key] += 1
            else:
                data[year][key] = 1
        else:
            data[year] = {key: 1}


def main():
    keyword_first = 'devops'
    keyword_second = 'development operations'
    filename = 'vacancies_2024.csv'
    file = open(filename, "r", encoding="utf-8-sig")
    reader = csv.DictReader(file)
    for row in reader:
        name = row['name']
        if row['key_skills'] == '':
            key_skills = []
        else:
            key_skills = list(row['key_skills'].split('\n'))
        if row['salary_from'] == '':
            salary_from = 0
        else:
            salary_from = int(float(row['salary_from']))
        if row['salary_to'] == '':
            salary_to = 0
        else:
            salary_to = int(float(row['salary_to']))
        salary_currency = row['salary_currency']
        published_at = datetime.strptime(row['published_at'], "%Y-%m-%dT%H:%M:%S%z")
        month = published_at.month
        area_name = row['area_name']
        year = published_at.year
        date = f"{year}-{month:02d}"
        salary = compute_salary(salary_from, salary_to, salary_currency, date)

        if (salary > 0) and (salary <= 10000000):
            add_value_dicts(year, salary, general_sum_salaries_years, general_count_salaries_years)
            add_value_dicts(area_name, salary, general_salaries_cities, general_count_salaries_cities)
        add_one_dict(year, general_count_vacancies_years)
        if area_name:
            add_one_dict(area_name, general_count_vacancies_cities)
        if key_skills:
            add_one_skills_dict(key_skills, year, general_skills_years)

        if (keyword_first in name) or (keyword_second in name):
            if (salary > 0) and (salary <= 10000000):
                add_value_dicts(year, salary, sum_salaries_years, count_salaries_years)
                add_value_dicts(area_name, salary, salaries_cities, count_salaries_cities)
            add_one_dict(year, count_vacancies_years)
            if area_name:
                add_one_dict(area_name, count_vacancies_cities)
            if key_skills:
                add_one_skills_dict(key_skills, year, skills_years)

    find_medium(general_sum_salaries_years, general_count_salaries_years, general_medium_salary_years)
    find_medium(general_salaries_cities, general_count_salaries_cities, general_medium_salary_cities)
    find_medium(sum_salaries_years, count_salaries_years, medium_salary_years)
    find_medium(salaries_cities, count_salaries_cities, medium_salary_cities)
    general_share_city = find_proc_dict(general_count_vacancies_cities)
    share_city = find_proc_dict(count_vacancies_cities)

